import React from 'react';
import axios from 'axios'
function InstagramLogin(props) {


    let login = () =>{
        axios.get('http://localhost:5000/login/groups?')
        .then(response => {
            console.log(response.data)
        })
    }

    return (
        <div>
            <button onClick={login}></button>
        </div>
    );
}

export default InstagramLogin;
